    false,nt"url": null,nt"notes": "Sherburne National Wildlife Refuge proposes
    to amend the present trapping plan in order to improve the quality of this program
    by providing more explicit direction to the trappers and more oversight of the program
    from Refuge staff. The proposed amendments retain the major thrust of the present
    plan while allowing for necessary refinements. They impact parts IV.C.2. (Trapper
    Eligibility Requirements), IV.C.6. (Trapping Units), IV.C.7. (Access) and IV.C.8.
    (Special Conditions) of the Refuge's Trapping Plan and associated Environmental
    Assessment, approved on 12 December 1986.",nt"license_title": "License Not
